import { Component } from 'react';

import logo from './logo.svg';
import './App.css';

class App extends Component {

  constructor() {
    super();

    this.state = {
      monsters: [
        {
          name: 'Linda',
          id: '12jdbgj12'
        },
        {
          name: 'Frank',
          id: '12gfkljewlsm2'
        },
        {
          name: 'Jacky',
          id: '123dddwlsm2'
        },
        {
          name: 'Nancy',
          id: 'fdlihdkweb1239'
        }
      ]
    }
  }

  render() {
    return (
      <div className="App">
        {
          this.state.monsters.map(monster => {
            return <div key={monster.id}>
              <h1>{monster.name}</h1>
            </div>
          })
        }
      </div>
    );
  };

}

export default App;
